import React, {Component} from 'react';
import styled from 'styled-components';

class Header extends Component{
    render(){
        return(
            <Container>
                <Element>
                    <Logo>
                        Khusinsa
                    </Logo>
                    <Nav>
                        <NavList>
                            <NavItem>상품 검색</NavItem>
                            <NavItem>주문 내역</NavItem>
                            <NavItem>회원 정보</NavItem>
                        </NavList>
                    </Nav>
                    <Sign>
                        <SignItem>회원가입/로그인</SignItem>
                    </Sign>
                </Element>
            </Container>
        )
    }
}


export default Header;


const Container = styled.div`
    width: 100%;
    border-bottom: 1px solid black;
`
